// chaining function for collecting nodes, loads, chains
const chainCollector = function(jointI, prevJointI, prevItem, node) {
    if (jointI == -1) { // invalid case
        return -1;
    }

    // joint setup
    let joint = joints[jointI];
    visitedJoints.add(jointI);
    joint.prevJointI = prevJointI;
    joint.prevItem = prevItem;
    joint.divs = 0;
    if (node == null) { // create a new node if none exists
        node = new Node();
        node.terminalJoints.add(jointI);
        nodes.add(node);
    }
    // assign node to the joint
    joint.node = node;
    node.jointsI.add(jointI);
    // if previous item is a load, add as adjacent load
    if (prevItem != null && prevItem != -1) {
        let prevName = prevItem.getName();
        if (prevName == 'Lightbulb') {
            //addDebug('PENIS');
            node.adjLoads.add(prevItem);
            prevItem.nodes.add(node);
            //loads.get(prevItem).add(joint.node);
            //loads.get(prevItem).add('ilikeass');
        }
    }

    //jointCount++;

    // base case, if other joint of battery found
    if (jointI != bjoint0 && ( bjoints.has(jointI) )) {
        // add this as a terminal
        node.terminalJoints.add(jointI);
        return jointI;
    }

    let endJointI = -1;

    // wire crawling for a node
    joint.wires.forEach( (wIndex, index) => {
        let wire = wires[wIndex];

        // get next joint of wire
        let itemJointsI = wire.joints;
        let nextJoint = -1;
        itemJointsI.forEach((itemJointI, index) => {
            if (itemJointI == jointI) {
                return;
            }
            if (visitedJoints.has(itemJointI)) {
                // two cases, its the previous joint or its a diff joint with a diff node
                if (itemJointI == joint.prevJointI) {
                    return;
                }
                let oldJoint = joints[itemJointI];
                let oldNode = oldJoint.node;
                if (oldNode == joint.node) { // make sure the nodes haven't already been merged
                    return;
                }
                // not previous joint, seperate node exists
                // merge nodes together, replace this one with the pre-existing one

                node.terminalJoints.forEach((jIndex, index) => { oldNode.terminalJoints.add(jIndex); });
                node.adjLoads.forEach((load, index) => { 
                    oldNode.adjLoads.add( load ); 

                    // replace adjacent node inside the load
                    load.nodes.delete(node);
                    load.nodes.add(oldNode);
                }); // may cause errors lateR?

                // joint updates node removals blah blah
                node.jointsI.forEach((jIndex, index) => {
                    let joint = joints[jIndex];

                    joint.node = oldNode;
                });

                nodes.delete(node);
                node = oldNode;
                joint.divs++;
                addDebug('MERGER AHH\n');
                
                return;
            }
            joint.divs++;
            nextJoint = itemJointI;
        });

        // should return last joint
        let tailJointI = chainCollector(nextJoint, jointI, wire, node);
        if (tailJointI != -1) {
            endJointI = tailJointI;
        }
    } );

    //run check on bulbs/resistors
    joint.bulbs.forEach( (bulbI, index) => {
        let bulb = bulbs[bulbI];
        visitedLoads.add(bulb);

        // add as an adjacent load to the node
        node = joint.node;
        node.adjLoads.add( bulb );
        // add new load with adjacent node
        loads.add(bulb);
        if (!bulb.nodes) {
            bulb.nodes = new Set();
        }
        bulb.nodes.add(node);
        //loads.set(bulb, new Set());
        //loads.get(bulb).add(joint.node);
        // terminates because its a load
        node.terminalJoints.add(jointI);

        // get next joint of wire
        let itemJointsI = bulb.joints;
        let nextJoint = -1;
        itemJointsI.forEach((itemJointI, index) => {
            if (itemJointI == jointI) {
                return;
            }
            if (visitedJoints.has(itemJointI)) { 
                // two cases, its the previous joint or its a diff joint with a diff node
                /*if (itemJointI == joint.prevJointI) {
                    return;
                }*/
                return;
            }
            nextJoint = itemJointI;
            joint.divs++;
        });

        let tailJointI = chainCollector(nextJoint, jointI, bulb, null);
        if (tailJointI != -1) {
            endJointI = tailJointI;
        }
    } );

    // if this is a terminal joint and not the battery joint
    if (joint.divs == 0) {
        //addDebug('Joint divs = 0\n');
        //joint.setZOrder(0);
        // run a traceback
        pruneBranch(jointI);
    }

    return endJointI;
}
