// run traceback on an open end to delete entire nodes and loads attached
function pruneBranch(jointI) {
    // invalid case, such as no previous joints case
    if (jointI == -1 || jointI == null) {
        return;
    }

    let joint = joints[jointI];

    // tell previous joint they just lost one :'(
    if (joint.prevJointI != null && joint.prevJointI != -1) {
        let prevJoint = joints[joint.prevJointI];
        prevJoint.divs--;
    }

    // if previous item is a load, remove it from the load tracking
    if (joint.prevItem != null) {
        let prevItem = joint.prevItem;
        let itemName = joint.prevItem.getName();
        if (itemName == 'Lightbulb') {
            loads.delete(joint.prevItem);
        }
    }

    let node = joint.node;

    node.jointsI.delete(jointI);
    // remove joint as a terminal joint in the node if its in there
    node.terminalJoints.delete(jointI);
    // remove node if its empty
    if (node.terminalJoints.size == 0) {
        nodes.delete(node);
    }

    prunes++;
}
