// solve linear equations in matrix form
function solveMat(matrix) {
    let size = matrix.length;

    // reduce to row echelon form, except for constants
    let i = 0; // index of column we're trying to reduce
    for (i = 0; i < size; i++) {
        // row manipulation for an i -> reduce the column by subtracting by og row divided by originC
        let originC = matrix[i][i];
        for (let b = i + 1; b < size && (originC == 0); b++) { // switch rows until originC is not 0
            let temp = matrix[b];
            matrix[b] = matrix[i];
            matrix[i] = temp;

            originC = matrix[i][i];
        }
        if (originC == 0) { // no solutions for this var
            continue;
        }
        // swap til we get a row without 0 for origin c
        for (let n = i + 1; n < size; n++) {
            let row = matrix[n];
            let newC = matrix[n][i];
            row.forEach((entry, index) => {
                matrix[n][index] = matrix[n][index] - newC * matrix[i][index] / originC;
            });
        }
    }

    // then reduce again to diagonal, with solutoin constants on right col
