}
function solveLin(mat) {
    solveMat(mat);

    // get solutions by creating an array to put all shit into
    let solns = [];
    let size = mat.length;
    mat.forEach((row, index) => {
        let coef = row[index];
        let cons = row[size];

        solns.push(cons / coef);
    });

    return solns;
}

